import { EmailIcon } from '../../icons/Email';
import { GithubIcon } from '../../icons/Github';
import { LinkedIn } from '../../icons/LinkedIn';
import { PageContainer, LinkContainer, GreetingContent,TextContent, AboutMeHeader, AboutMeContent} from './styles';
// import SelfieImage from '../../assets/image.png';

const About = () => {
  return (
    <PageContainer>
      <GreetingContent>Hi, I'm Steven Liu</GreetingContent>
      <TextContent>I've always loved solving problems and being a technophile who was obsessed with the latest tech.</TextContent>
      <LinkContainer>
        <GithubIcon />
        <LinkedIn />
        <EmailIcon />
      </LinkContainer>
      <AboutMeHeader>About me</AboutMeHeader>
    <AboutMeContent>
I'm relatively new to the world of web dev and programming in general, but I've gained a lot of experience from maintaining open source projects and their documentation sites. I like types, utility classes, multi-page applications, markdown, and Safari. I think I'm a fullstack developer but that's more out of necessity.</AboutMeContent>
<AboutMeContent>When I don't have VSCode or Github open, I enjoy taking photos, drawing, playing games, traveling, and cooking. Italian cuisine is my favorite.</AboutMeContent>


<AboutMeContent>Feel free to message me on Twitter or Discord! </AboutMeContent>
    </PageContainer>
  );
};

export default About;
